import React, {Component} from 'react';
import {MenuItems} from "./MenuItems";
import './NavNew.css'

class NavNew extends Component {
    state={clicked:false}
    handelClick=()=>{
        this.setState({clicked:!this.state.clicked})
    }

    render() {
        return (


                <nav className="NavberItems">
                    <h1 className="navber-logo">React<i className="fab fa-react"> </i></h1>
                    <div className="menu-icon" onClick={this.handelClick}>
                        <i className={this.state.clicked ? 'fas fa-times' : 'fas fa-bars'}></i>
                    </div>
                    <ul>
                        {MenuItems.map((item,index)=>{
                            return(
                                <li key={index}> <a className={MenuItems.cName} herf={item.url}>
                                    {item.title}
                                     </a>
                                </li>

                        )
                        })}


                    </ul>
                </nav>


        );
    }
}

export default NavNew;
